import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Container,
  Label,
  Menu,
  Card,
  Loader,
  Segment,
  Dimmer,
  Image,
  Header,
  Icon,
} from "semantic-ui-react";
import { returnRequestsActions } from "../../actions";
import { ReturnRequestCard } from "./ReturnRequestCard";

class ViewMyReturnRequests extends Component {
  state = { activeItem: "Bought Items" };
  async componentDidMount() {
    await this.props.loadAllReturnRequests();
  }

// async handleCancelRequest(requestId){
// await this.props.cancelReturnRequest(requestId);
// }

  handleItemClick = (e, { name }) => this.setState({ activeItem: name });
  render() {
    const { returnRequests } = this.props;
    const { loaded } = returnRequests;
    return (
      <Container style={{ padding: "2em 2em" }}>
        <Label color='purple' size='huge' ribbon>
          My Return Requests
        </Label>
        <Menu tabular>
          <Menu.Item
            name='Bought Items'
            active={this.state.activeItem === "Bought Items"}
            onClick={this.handleItemClick}
          />
          <Menu.Item
            name='Sold Items'
            active={this.state.activeItem === "Sold Items"}
            onClick={this.handleItemClick}
          />
        </Menu>
        {loaded ? (
          this.state.activeItem === "Bought Items" ? (
            <Card.Group centered itemsPerRow={4} stackable>
              {!(returnRequests.buyerReturnRequests.length === 0) ? (
                returnRequests.buyerReturnRequests.map((request) => {
                  return (
                    <ReturnRequestCard
                      request={request}
                      key={request._id}
                      id={request._id}
                      title={request.item.post.title}
                      requestStatus={request.status}
                      reason={request.reason}
                      investigation={request.investigation.status}
                      outcome={request.investigation.outcome}
                      date={request.createdAt}
                      decision={request.sellerData.decision}
                      orderID={request.order}
                      buyer={true}
                      sellerReason={request.sellerData.sellerRejectionReason}
                      buyerNotes={request.investigation.buyerNotes}
                    />
                  );
                })
              ) : (
                <Header style={{ marginTop: "5%" }} as='h2' icon>
                  <Icon name='clipboard outline' />
                  No Return Requests
                  <Header.Subheader>
                    Looks like you do not have any return requests right now.
                  </Header.Subheader>
                </Header>
              )}
            </Card.Group>
          ) : (
            <Card.Group centered itemsPerRow={4} stackable>
              {!(returnRequests.sellerReturnRequests.length === 0) ? (
                returnRequests.sellerReturnRequests.map((request) => {
                  return (
                    <ReturnRequestCard
                     request={request}
                      key={request._id}
                      id={request._id}
                      title={request.item.post.title}
                      requestStatus={request.status}
                      reason={request.reason}
                      investigation={request.investigation.status}
                      outcome={request.investigation.outcome}
                      date={request.createdAt}
                      decision={request.sellerData.decision}
                      orderID={request.order}
                      buyer={false}
                      sellerReason={request.sellerData.sellerRejectionReason}
                      buyerNotes={request.investigation.buyerNotes}
                    />
                  );
                })
              ) : (
                <Header style={{ marginTop: "5%" }} as='h2' icon>
                  <Icon name='clipboard outline' />
                  No Return Requests
                  <Header.Subheader>
                    Looks like you do not have any return requests right now.
                  </Header.Subheader>
                </Header>
              )}
            </Card.Group>
          )
        ) : (
          <Segment>
            <Dimmer active inverted>
              <Loader inverted content='Loading' />
            </Dimmer>

            <Image src='https://react.semantic-ui.com/images/wireframe/short-paragraph.png' />
          </Segment>
        )}
      </Container>
    );
  }
}

function mapState(state) {
  return {
    ...state,
  };
}

const actionCreators = {
  loadAllReturnRequests: returnRequestsActions.loadAllReturnRequests,
  cancelReturnRequest:returnRequestsActions.cancelReturnRequest,
};

const connectedViewMyReturnRequests = connect(
  mapState,
  actionCreators
)(ViewMyReturnRequests);

export { connectedViewMyReturnRequests as ViewMyReturnRequests };
